/* Program to check the homogenous */
#include <iostream>
#include <string>
using namespace std;

int countHomogenous(string input)
{
    int result = 1;
    int len = input.length();
    int counter = 1; // holding the previous value
    for (int i = 1; i < len; i++)
    {
        // comparing from the previous char
        if (input[i - 1] == input[i])
        {
            // here previos char and current index char are equal
            result = result + (++counter);
        }
        else
        {
            counter = 1;
            result = result + counter;
        }
    }
    return result % 100000007;
}

int main()
{
    string input = "abbcccaa";
    cout << "\n Result: " << countHomogenous(input);
    string input1 = "xy";
    cout << "\n Result: " << countHomogenous(input1);
    string s1 = "";
    cout << "\n Result: " << countHomogenous(s1);
    return 0;
}
